import VideoPanel from './Components/VideoPanel';
import MentorPanel from './Components/MentorPanel';
import TeamRoles from './Components/TeamRoles';

function App() {
   const components=[      
    <Button
      text="Location"
      panel= {<LocationPanel />}
    />,
    
   <Button 
      text="Mentor Details"
      panel={<MentorPanel/>}
   />
    ,
   <Button 
      text="Intro Video"
      panel={<VideoPanel/>}
    
   />]
   
    return ( 
      <>
      <TeamRoles />
    </>
    )
}
export default App;
